import React from "react";
import "../../css/login.css";
import {} from "react-router-dom";
import MailOutlineIcon from "@mui/icons-material/MailOutline";
import LockIcon from "@mui/icons-material/Lock";
import { TextField, InputAdornment, Link } from "@mui/material";
import {} from "@mui/material";
// import Signup from "./Signup";
function Login() {
  return (
    <>
      <div className="main-box">
        <div className="form-box">
          <h4 className="login-heading">Log in to your account</h4>
          <div className="paragraph">
            <p>
              Amet minim mollit non deserunt ullamco est sit aliqua dolor do amet sint. Velit
              officia mollit non deserunt ullamco consequat.
            </p>
          </div>
          <form>
            <div>
              <label className="email-lable">Email address</label>
              <br />
              <TextField
                fullWidth
                name="email"
                label="email"
                placeholder="enter email"
                variant="outlined"
                size="small"
                InputProps={{
                  startAdornment: (
                    <InputAdornment position="start">
                      <MailOutlineIcon />
                    </InputAdornment>
                  ),
                }}
              />
              <br />
              <label className="password-lable">Password</label>
              <br />
              <TextField
                fullWidth
                name="password"
                label="password"
                placeholder="enter password"
                variant="outlined"
                size="small"
                InputProps={{
                  startAdornment: (
                    <InputAdornment position="start">
                      <LockIcon />
                    </InputAdornment>
                  ),
                }}
              />
              <br />
              <input type="checkbox" />
              <label className="checkbox-lable">Keep me signed in</label>
              <label className="forget-data">Forget password</label>
              <br />
              <button className="button">Sign in</button>
              <br />
              <p className="paragraph">
                Not Registered yet?{" "}
                <Link to="/signup">
                  <span style={{ color: "#33334f" }}>Create a new account</span>
                </Link>
              </p>
            </div>
          </form>
        </div>
      </div>
    </>
  );
}

export default Login;
